package persistence_test

import (
	"bytes"
	"encoding/binary"
	"log"
	"testing"

	"github.com/godis/conf"
	"github.com/godis/data"
	"github.com/godis/persistence"
	"github.com/sirupsen/logrus"

	"github.com/stretchr/testify/assert"
)

func TestWriteString(t *testing.T) {
	tests := []struct {
		name      string
		obj       *data.Gobj
		want      bool
		wantError bool
	}{
		{
			name: "Short string",
			obj: &data.Gobj{
				Val_: func() string { return "hello" }(),
			},
			want:      true,
			wantError: false,
		},
		{
			name: "Medium string",
			obj: &data.Gobj{
				Val_: func() string {
					return "abcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrstuvwxyzabcdefghijklmnopqrstuvwxyz"
				}(),
			},
			want:      true,
			wantError: false,
		},
		{
			name: "Long string",
			obj: &data.Gobj{
				Val_: func() string {
					return ""
				}(),
			},
			want:      true,
			wantError: false,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			buffer := new(bytes.Buffer)
			rdb := persistence.InitRDB(&conf.Config{}, logrus.New())
			rdb.WriteString(buffer, tt.obj)
			if len(tt.obj.StrVal()) < 2<<6-1 {
				l, _ := buffer.ReadByte()
				length := int(l)
				assert.Equal(t, length, len(tt.obj.StrVal()))

				bytes := make([]byte, length)
				buffer.Read(bytes)
				assert.Equal(t, tt.obj.StrVal(), string(bytes))
			} else if len(tt.obj.StrVal()) < 2<<14-1 {
				l, _ := buffer.ReadByte()
				ty := int(l) >> 6
				length := (int(l) & 0x3f) << 8
				l, _ = buffer.ReadByte()
				length += int(l)
				assert.Equal(t, ty, 0x01)
				assert.Equal(t, length, len(tt.obj.StrVal()))
				bytes := make([]byte, length)
				buffer.Read(bytes)
				assert.Equal(t, tt.obj.StrVal(), string(bytes))
			} else {
				l, _ := buffer.ReadByte()
				ty := int(l) >> 6
				assert.Equal(t, ty, 0x02)
				p := make([]byte, 4)
				buffer.Read(p)
				length := int(binary.BigEndian.Uint32(p))
				assert.Equal(t, len(tt.obj.StrVal()), length)
				bytes := make([]byte, length)
				buffer.Read(bytes)
				assert.Equal(t, tt.obj.StrVal(), string(bytes))
				log.Println(length, len(tt.obj.StrVal()))
			}
		})
	}
}
